  <script src="runtime.332e9e9b7bbd6596.js" type="module"></script><script src="polyfills.2d5c3321aee013a2.js" type="module"></script><script src="main.25a73ee1acf2d880.js" type="module"></script>
  <script>
    var segmentCount = 1;

      var l = window.location;
      l.replace(
        l.protocol + '//' + l.hostname + (l.port ? ':' + l.port : '') +
        l.pathname.split('/').slice(0, 1 + segmentCount).join('/') + '/?p=/' +
        l.pathname.slice(1).split('/').slice(segmentCount).join('/').replace(/&/g, '~and~') +
        (l.search ? '&q=' + l.search.slice(1).replace(/&/g, '~and~') : '') +
        l.hash
      );
    </script>
  </body></html>
